import "./SearchResult.css";

export const SearchResult = ({ result }) => {
  function gomble() {
    document.getElementById("konyvvv").value = result
    var resultsList=document.querySelectorAll(".results-list")[0]
    var searchresult=document.createElement("div")
    searchresult.classList.add("search-result")
    searchresult.innerText=""
    for(let i=0; i<resultsList.childElementCount; i++){
      resultsList.removeChild(resultsList[i])
    }
    resultsList.appendChild(searchresult)
  }
  return (
    <div
      className="search-result"
      onClick={() => { gomble() }}
    >
      {result}
    </div>
  );
};
